(function () {
	angular.module('mockModule', ['ngMockE2E'])
	.run(run);

	function run($httpBackend) {
		// fake list of matches for populating GET
		var matches = [
			{
				id: 0,
				logo1: '',
				team1: 'Chelsea',
				result1: 1,
				logo2: '',
				team2: 'Manchester United',
				result2: 0
			},
			{
				id: 1,
				logo1: '',
				team1: 'Aston Villa',
				result1: 0,
				logo2: '',
				team2: 'Tottenham',
				result2: 0
			}
		];

		// fake individual match for populating GET :id
		var match = {
			id: 1,
			result: '',
			alignment: '4-3-3'
		}

		// returns the current list of matches
		$httpBackend.whenGET(/\/game\/$/).respond(matches);
		// returns an individual match
		$httpBackend.whenGET(/\/game\/[0-9]+$/).respond(match);

		// pass with every template request
		$httpBackend.whenGET('./src/modules/home/home.tpl.html').passThrough();
		$httpBackend.whenGET('./src/modules/sentiment/sentiment.tpl.html').passThrough();
		$httpBackend.whenGET('./src/modules/games/games.tpl.html').passThrough();
		$httpBackend.whenGET('./src/modules/features/features.tpl.html').passThrough();
		$httpBackend.whenGET('./src/modules/pricing/pricing.tpl.html').passThrough();
	}
})();